(function() {
  'use strict';

  app.service('Storage', ['$window', Storage]);

  function Storage($window) {
    this.prefix = 'mulou-garous.';
    this.storage = $window.localStorage;
  }

  Storage.prototype.has = function(key) {
    var value = this.storage.getItem(this.prefix + key);
    return typeof value != 'undefined' && value !== null
  }
  Storage.prototype.get = function(key, defaultVal) {
    if(this.has(key))
      return JSON.parse(this.storage.getItem(this.prefix + key));
    else
      return defaultVal;
  }
  Storage.prototype.set = function(key, value) {
    return this.storage.setItem(this.prefix + key, JSON.stringify(value));
  }
  Storage.prototype.remove = function(key) {
    if(this.has(key)) {
      this.storage.removeItem(this.prefix + key);
      return true;
    }
    else
      return false;
  }
})();

if (!Array.prototype.findIndex) {
  Array.prototype.findIndex = function(predicate) {
    if (this == null) {
      throw new TypeError('Array.prototype.findIndex appelé sur null ou undefined');
    }
    if (typeof predicate !== 'function') {
      throw new TypeError('predicate doit être une fonction');
    }
    var list = Object(this);
    var length = list.length >>> 0;
    var thisArg = arguments[1];
    var value;

    for (var i = 0; i < length; i++) {
      value = list[i];
      if (predicate.call(thisArg, value, i, list)) {
        return i;
      }
    }
    return -1;
  };
}


(function() {
  'use strict';

  app.controller('ConfigurationController', function($scope, Storage) {
    // Players count
    $scope.configuration.players = Storage.get('configuration.players', 4);

    // Roles
    $scope.configuration.roles = Storage.get('configuration.roles', []);
    $scope.configuration.defaultRole = null;
    $scope.configuration.saveRoles = function () {
      Storage.set('configuration.roles', $scope.configuration.roles);
    }
    $scope.configuration.addRole = function() {
      $scope.configuration.roles.push({ playersCount: 1 });
      $scope.configuration.saveRoles();
    }
    $scope.configuration.removeRole = function(index) {
      $scope.configuration.roles.splice(index, 1);
      $scope.configuration.saveRoles();
    }
  });
})();

(function() {
  'use strict';

  app.controller('GamePlayController', function($scope, Storage, LxNotificationService, LxDialogService) {
    function shuffleArray(a) {
      var i, t, j;
      for (i = a.length - 1; i > 0; i -= 1) {
        t = a[i];
        j = Math.floor(Math.random() * (i + 1));
        a[i] = a[j];
        a[j] = t;
      }
      return a;
    }

    $scope.gamePlay.players = Storage.get('gamePlay.players', []);
    $scope.gamePlay.savePlayers = function() {
      Storage.set('gamePlay.players', $scope.gamePlay.players);
    };
    $scope.gamePlay.launch = function() {
      // Set players' role to null
      $scope.gamePlay.players = $scope.gamePlay.players.map(function(value) {
        value.role = null;
        return value;
      });
      var players = shuffleArray($scope.gamePlay.players.slice()); // Copy the players array
      $scope.configuration.roles.slice().sort(function(a, b) {
        if (a.playersCount < b.playersCount) {
          return -1;
        } else if (a.playersCount > b.playersCount) {
          return 1;
        } else {
          return 0;
        }
      }).forEach(function(role) { // Set a role to each players
        var player;
        for (var i = 0; i < role.playersCount; i++) {
          if (players.length == 0) {
            return;
          }

          player = players.shift();
          player.role = role.name;
        }
      });
      if (players.length == 0)
        return;

      if ($scope.configuration.defaultRole == null) {
        LxNotificationService.error('Il n\'y pas assez de roles pour tous les joueurs, veuillez définir un rôle par défaut.');
      } else {
        var player;
        for (var i = 0; i < players.length; i++) {
          player = players[i];
          player.role = $scope.configuration.defaultRole.name;
        }
      }
    };

    $scope.gamePlay.resetVotes = function() {
      $scope.gamePlay.players.forEach(function(player) {
        player.votes = null;
      });
    }

    $scope.$watch('configuration.players', function(value) {
      if (typeof value != 'number' || $scope.gamePlay.launched)
        return;

      var newPlayers;
      if ((newPlayers = value - $scope.gamePlay.players.length) > 0) {
        if ($scope.launched)
          return;
        for (var i = 0; newPlayers > i; i++) {
          $scope.gamePlay.players.push({
            nickName: null,
            role: null
          });
        }
      } else {
        $scope.gamePlay.players = $scope.gamePlay.players.slice(0, value);
      }
      Storage.set('configuration.players', value);
    });

    $scope.gamePlay.marry = function(player) {
      $scope.marry.player = player;
      LxDialogService.open('marry');
    }

  });
})();

